        public void ShouldNegatePointsCorrectly(Curve curve, string xHex, string yHex, string resultXHex, string resultYHex)
        {
            var x = LoadValue(xHex);
            var y = LoadValue(yHex);
            var resultx = LoadValue(resultXHex);
            var resulty = LoadValue(resultYHex);

            var a = new EccPoint(x, y);
            var expectedResult = new EccPoint(resultx, resulty);

            var factory = new EccCurveFactory();
            var subject = factory.GetCurve(curve);

            var result = subject.Negate(a);

            Assert.AreEqual(expectedResult.X, result.X, "x");
            Assert.AreEqual(expectedResult.Y, result.Y, "y");
        }

        private BigInteger LoadValue(string value)
        {
            return new BitString(value).ToPositiveBigInteger();
        }
